import { Link } from "react-router-dom";
import { useState, useEffect } from "react";

const Viewfeedback = () => {
  let [reviews, updatecategory] = useState([]);
  //let [srt_reviews, sort] = useState([]);

  const getAllreview = () => {
    fetch("http://localhost:5556/getreviews?category=all")
      .then((response) => response.json())
      .then((reviewarray) => {
        //alert(reviewarray);
        updatecategory(reviewarray);
      });
  };

 /* const getAllreview = () => {
    /*sort([]);
    reviews.map((review, index) => {
      sort((srt_reviews) => [...srt_reviews, review]);
    });
  };*/

  const getfeature = () => {
   /* sort([]);
    reviews.map((review, index) => {
      if (review.topics == "Feature") {
        sort((srt_reviews) => [...srt_reviews, review]);
      }
    });
    //alert(srt_reviews.length)
    */
    fetch("http://localhost:5556/getreviews?category=feature")
    .then((response) => response.json())
    .then((reviewarray) => {
      //alert(reviewarray);
      updatecategory(reviewarray);
    });
  };

  const getpricing = () => {
    /* sort([]);
    reviews.map((review, index) => {
      if (review.topics == "Pricing") {
        sort((srt_reviews) => [...srt_reviews, review]);
      }
    });
    */
    fetch("http://localhost:5556/getallreview?category=pricing")
    .then((response) => response.json())
    .then((reviewarray) => {
      //alert(reviewarray);
      updatecategory(reviewarray);
    });
  };

  const getusability = () => {
    /*sort([]);
    reviews.map((review, index) => {
      if (review.topics == "Usability") {
        sort((srt_reviews) => [...srt_reviews, review]);
      }
    });*/
    fetch("http://localhost:5556/getallreview?category=pricing")
    .then((response) => response.json())
    .then((reviewarray) => {
      //alert(reviewarray);
      updatecategory(reviewarray);
    });
  };

  useEffect(() => {
    getreview();
    //getAllreview();
  }, [1]);

  return (
    <section>
      <div class="container ">
        <div className="row mt-5">
          <div className="col-lg-12 text-center fs-1 text-warning menu">  Feedbacks </div>
        </div>
        <div className="row ">
          <div className="col-lg-12 p-5 text-center">
            <div className="btn btn-group">
              <button
                className="btn btn-primary text-white fs-6 "
                style={{ padding: "4px 15px 4px" }}
                onClick={getAllreview}
              >
                All
              </button>
              <button
                className="btn btn-info text-white fs-6"
                style={{ padding: "4px 15px 4px" }}
                onClick={getfeature}
              >
                Features
              </button>
              <button
                className="btn btn-success text-white fs-6"
                style={{ padding: "4px 15px 4px" }}
                onClick={getpricing}
              >
                Pricing
              </button>
              <button
                className="btn btn-warning text-white fs-6"
                style={{ padding: "4px 15px 4px" }}
                onClick={getusability}
              >
                Usability
              </button>
            </div>
          </div>
        </div>
        <div className="row mb-5">
          <div className="container p-5  bg-light rounded">
            <div className="row">
              <u> {" "} <h3 className="text-center underlined">   {" "}   Total feedbacks : {srt_reviews.length}{" "}</h3>{" "}   </u>
              <div className="col-lg-3"> </div>
              <div className="col-lg-6">
                {srt_reviews.map((review, index) => {
                  return (
                    <section className="row text-center mt-5">
                      <h3> feedback: {index + 1} </h3>
                      <table
                        className="table table-bordered format rounded text-center mb-5"
                        cellSpacing={1}
                        cellPadding={20}
                      >
                        <tr>
                          <th>Author</th>
                          <td>{review.author}</td>
                        </tr>

                        <tr>
                          <th>Title</th>
                          <td>{review.name}</td>
                        </tr>

                        <tr>
                          <th>category</th>
                          <td>{review.topics}</td>
                        </tr>

                        <tr>
                          <th>Description</th>
                          <td> {review.description}</td>
                        </tr>

                        <tr>
                          <th>Rating</th>
                          <td> {review.rating} out of 5 </td>
                        </tr>
                      </table>
                    </section>
                  );
                })}
              </div>
              <div className="col-lg-3"> </div>
            </div>
          </div> {/* container end*/}
        </div> {/* row end*/}
      </div> {/* container end*/}
    </section>
  );
};

export default Viewfeedback;
